function doCreateText() {
  var i = bridge.Id_Text();
  var val = "tspan0"+i;
  var newText = document.createElementNS('http://www.w3.org/2000/svg',"text");
  newText.setAttributeNS(null,"x",20);      
  newText.setAttributeNS(null,"y",100);   
  newText.setAttributeNS(null,"id",val);
  newText.setAttributeNS(null,"class","draggable");
  var textNode = document.createTextNode("text");
  newText.appendChild(textNode);
  document.getElementById("Capa_1").appendChild(newText);
}
